CREATE TABLE indiewise_db.Genres
(
    id char(36) PRIMARY KEY NOT NULL,
    genre char(36),
    project char(36),
    user char(36),
    CONSTRAINT genre_genre_bkname_selectedby FOREIGN KEY (genre) REFERENCES Genre (id) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT project_project_bkname_genres FOREIGN KEY (project) REFERENCES Project (id) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT users_user_bkname_genres FOREIGN KEY (user) REFERENCES users (id) ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE UNIQUE INDEX genres_id_unique ON indiewise_db.Genres (id);
CREATE INDEX genre_genre_bkname_selectedby ON indiewise_db.Genres (genre);
CREATE INDEX project_project_bkname_genres ON indiewise_db.Genres (project);
CREATE INDEX users_user_bkname_genres ON indiewise_db.Genres (user);
